import React, { useState } from "react";

const Maintile = () => {
  const [showDetails, setShowDetails] = useState(false);

  const handleDetailsToggle = () => {
    setShowDetails(!showDetails);
  };

  return (
    <div
      className="section is-fullheight"
      style={{
        backgroundColor: "#f9f9f9",
        display: "flex",
        flexDirection: "column",
        justifyContent: "flex-start", // Shift vertically
        alignItems: "center",
        minHeight: "100vh",
        paddingTop: "80px", // Add more space at the top
      }}
    >
      {/* Hero Section */}
      <div
        className="hero-body columns is-vcentered"
        style={{
          maxWidth: "1200px",
          width: "90%",
          padding: "20px",
          margin: "0 auto",
        }}
      >
        {/* Text Content */}
        <div
          className="column is-6"
          style={{
            marginRight: "40px", // Shift text to the left
          }}
        >
          <div className="container">
            <h1
              className="title"
              style={{
                fontSize: "3rem",
                color: "#333",
                lineHeight: "1.5",
                cursor: "pointer",
              }}
              onMouseOver={(e) => (e.target.style.color = "#007bff")} // Hover effect
              onMouseOut={(e) => (e.target.style.color = "#333")}
            >
              Hola Amigo! &nbsp; 👋
            </h1>
            <h2
              className="subtitle has-text-weight-semibold"
              style={{
                fontSize: "1.25rem",
                color: "#555",
                marginTop: "20px",
              }}
            >
              <p>
                If you are looking for a place where you can get information
                about:
              </p>
              <ul
                style={{
                  listStyleType: "none",
                  paddingLeft: "0",
                  marginTop: "20px",
                }}
              >
                <li
                  style={{
                    transition: "transform 0.3s ease",
                    cursor: "pointer",
                  }}
                  onMouseOver={(e) =>
                    (e.target.style.transform = "scale(1.05)")
                  }
                  onMouseOut={(e) =>
                    (e.target.style.transform = "scale(1)")
                  }
                >
                  ➤ Campus Ambassador Programs
                </li>
                <li
                  style={{
                    transition: "transform 0.3s ease",
                    cursor: "pointer",
                  }}
                  onMouseOver={(e) =>
                    (e.target.style.transform = "scale(1.05)")
                  }
                  onMouseOut={(e) =>
                    (e.target.style.transform = "scale(1)")
                  }
                >
                  ➤ Active Scholarships
                </li>
                <li
                  style={{
                    transition: "transform 0.3s ease",
                    cursor: "pointer",
                  }}
                  onMouseOver={(e) =>
                    (e.target.style.transform = "scale(1.05)")
                  }
                  onMouseOut={(e) =>
                    (e.target.style.transform = "scale(1)")
                  }
                >
                  ➤ Full-Time Opportunities
                </li>
                <li
                  style={{
                    transition: "transform 0.3s ease",
                    cursor: "pointer",
                  }}
                  onMouseOver={(e) =>
                    (e.target.style.transform = "scale(1.05)")
                  }
                  onMouseOut={(e) =>
                    (e.target.style.transform = "scale(1)")
                  }
                >
                  ➤ Intern Openings
                </li>
              </ul>
            </h2>
            <button
              className="button is-primary"
              style={{
                marginTop: "20px",
              }}
              onClick={handleDetailsToggle}
            >
              {showDetails ? "Hide Details" : "Learn More"}
            </button>
          </div>
        </div>

        {/* Image Section */}
        <div
          className="column is-6"
          style={{
            marginLeft: "40px", // Shift image to the right
          }}
        >
          <center>
            <img
              src="https://i.ibb.co/2qK1ZSc/intro.png"
              alt="student mantra"
              style={{
                borderRadius: "15px",
                width: "90%",
                maxWidth: "500px",
                transition: "transform 0.3s ease",
                cursor: "pointer",
              }}
              onMouseOver={(e) =>
                (e.target.style.transform = "scale(1.1)")
              }
              onMouseOut={(e) => (e.target.style.transform = "scale(1)")}
            />
          </center>
        </div>
      </div>

      {/* Additional Information */}
      {showDetails && (
        <div
          className="box"
          style={{
            backgroundColor: "#fff",
            padding: "20px",
            borderRadius: "10px",
            marginTop: "30px",
            transition: "opacity 0.5s ease",
            width: "80%",
            maxWidth: "800px",
            textAlign: "center",
          }}
        >
          <p>
            <b>
              Whichever listing you are looking for, we have a dedicated section
              for it! Explore our platform to find exactly what you need. 🚀
            </b>
          </p>
        </div>
      )}
    </div>
  );
};

export default Maintile;
